DROP TABLE T_UTILISATEUR_CONVERSATION;
DROP TABLE T_MESSAGE;
DROP TABLE T_CONVERSATION;
DROP TABLE T_UTILISATEUR;


CREATE TABLE T_UTILISATEUR (
  UT_ID BIGSERIAL,
  UT_PSEUDO VARCHAR(255) NOT NULL,
  UT_MAIL VARCHAR(255) NOT NULL ,
  UT_PRENOM VARCHAR(255),
  UT_NOM VARCHAR(255),
  UT_DT_NAISSANCE DATE NOT NULL,
  UT_SEXE SMALLINT,
  UT_MDP VARCHAR(512),
  UT_SALT VARCHAR(20),
  UT_ACTIF BOOLEAN,
  CONSTRAINT t_utilisateur_ut_id_pk PRIMARY KEY (UT_ID)
);

CREATE TABLE T_CONVERSATION (
  CO_ID BIGSERIAL,
  CO_NOM TEXT NULL,
  CO_DT_CREATION TIMESTAMP NOT NULL,
  UT_ID BIGINT NOT NULL,
  CONSTRAINT t_conversation_co_id_pk PRIMARY KEY (CO_ID),
  CONSTRAINT t_conversation_ut_id_fk FOREIGN KEY(UT_ID) REFERENCES T_UTILISATEUR(UT_ID)
);



CREATE TABLE T_UTILISATEUR_CONVERSATION (
  UT_ID BIGINT,
  CO_ID BIGINT,
  UC_MUTE TIMESTAMP,
  UC_DT_LU TIMESTAMP,
  CONSTRAINT t_utilisateur_conversation_ut_id_co_id_pk PRIMARY KEY(UT_ID,CO_ID),
  CONSTRAINT t_utilisateur_conversation_ut_id_fk FOREIGN KEY(UT_ID) REFERENCES T_UTILISATEUR(UT_ID),
  CONSTRAINT t_utilisateur_conversation_co_id_fk FOREIGN KEY(CO_ID) REFERENCES T_CONVERSATION(CO_ID)
);



CREATE TABLE T_MESSAGE (
  ME_ID BIGSERIAL,
  ME_CONTENT TEXT,
  ME_DT TIMESTAMP,
  ME_VISIBLE BOOLEAN,
  UT_ID BIGINT,
  CO_ID BIGINT,
  CONSTRAINT t_message_me_id_pk PRIMARY KEY (ME_ID),
  CONSTRAINT t_message_ut_id_fk FOREIGN KEY(UT_ID) REFERENCES T_UTILISATEUR(UT_ID),
  CONSTRAINT t_message_co_id_fk FOREIGN KEY(CO_ID) REFERENCES T_CONVERSATION(CO_ID)
);


















